import Layout from '../components/Layout';

const Auth = () => (
  <Layout>
    <section id="auth" className="container">
      <h1>Login</h1>
      <form>
        <div className="form-control">
          <label htmlFor="email">Email</label>
          <input type="email"/>
        </div>
        <div className="form-control">
          <label htmlFor="password">Password</label>
          <input type="password"/>
        </div>
        <button type="submit">Login</button>

      </form>





      <style jsx>{`

      h1 {
        font-size: 2rem;
      }
    
      .form-control {
        margin: 1.5rem 0;
      }

      input {
        padding: 0.2rem;
      }

      label {
        display: block;
        font-size: 1.2rem;
      }
      

    `}</style>
    
    </section>
  </Layout>
);

export default Auth;
